import { Route, Routes } from 'react-router-dom';  // Correct import for React Router v6
import Home from './components/Home';
import About from './components/About';
import Projects from './components/Projects';
import Contact from './components/Contact';
import Header from './components/Header'; // Assuming Header is your navigation bar component

function App() {
  return (
    <div>
      <Header /> {/* Include your header for navigation */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/projects" element={<Projects />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </div>
  );
}

export default App;
